import './App.css';
import React from 'react'
import Home from './pages/Home';
import ProductList from './pages/ProductList';
import Product from './pages/Product';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home/>
        </Route>
      </Switch>
    </Router>
  )
}

export default App;
